import React from 'react'
import htmlcssjs from '../Images/htmlcssjs.jpg'
let style = {
    backGround : 'cyan',
    textAlign : 'center',
    opacity : 0.4
}
function FrontEndTech() {
  return (
    <div style={style}>
      <img src={htmlcssjs} alt="Khizi"/>
    </div>
  )
}

export default FrontEndTech
